import { url_header } from "../utils/url_header";
import Header from "./Header";
import { useDispatch } from "react-redux";
import { addMovie, addNowPlayingMovie } from "../utils/movieSlice";
const Browse = () =>{
        const dispatch = useDispatch();
        const movies = async () =>{
            fetch('https://api.themoviedb.org/3/movie/now_playing?language=en-US&page=1', url_header)
  .then(response => response.json())
  .then(response => console.log(response))
  .catch(err => console.error(err));
  dispatch(addNowPlayingMovie(response))
        }
    useEffect(()=>{movies()},[]);
    return(

        <div>

            <Header/>
        </div>
    )
}
export default Browse;
